import React, { useState, useEffect } from "react";
import { reduxForm } from "redux-form";
import { compose } from "redux";
import {
  required,
  maxLengthMobileNo,
  minLengthMobileNo,
  digit
} from "../../helpers/validation";
import { getCustomerData } from "../../api.js";
const ProfileForm = (props) => {
  const {
    submitting,
    submitFailed,
  } = props;
  const [customerData, setCustomerData] = useState({
    email: "",
    phno: "",
    name: ""
  });
  const [error, setError] = useState(false);
  const [success, setSuccess] = useState(false);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const userData = localStorage.getItem('data');
      const customerInfo = await getCustomerData(userData);
      console.log("Customer Data : ", customerInfo);
      setCustomerData(customerInfo);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };
  const handleSubmit = async (e) => {
    e.preventDefault(); 


    const formData = new FormData(e.target);
    const email = formData.get('email');
    const name = formData.get('name');
    const phno = formData.get('confirmPassword');

    const allFieldsFilled = currentPassword.trim() !== '' && password.trim() !== '' && confirmPassword.trim() !== '';
    if (!allFieldsFilled) {
      return;
    } else if (password !== confirmPassword) {
      setError("Password doesn't match!");
      setSuccess(false);
      setTimeout(() => {
        setError(false);
        props.reset();
      }, 2000);
    } else {
      try {
        const userData = localStorage.getItem('data');
        const response = await changePassword(userData, currentPassword, password);
        console.log("Response : ", response);
        setSuccess("Password updated successfully!");
        setError(false);
        setTimeout(() => {
          setSuccess(false);
          props.reset();
        }, 2000);
      } catch (error) {
        console.error('Error changing password:', error);
        if (error.response && error.response.status === 401) {
          setError('Invalid current password!');
        }else{
        setError('Failed to update password!');
        }
        setSuccess(false);
        setTimeout(() => {
          setError(false);
          props.reset();
        }, 2000);
      }
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      className={`needs-validation ${submitFailed ? "was-validated" : ""}`}
      noValidate
    >
      <div className="card" style={{ paddingBottom: "5px", borderColor: "black" }}>
        <h5 className="card-header text-white" style={{ backgroundColor: "black" }}>
          <i className="bi bi-person-lines-fill" /> &nbsp;Profile Detail
        </h5>
        <ul className="list-group list-group-flush">
          <li className="list-group-item" >
            <label htmlFor="email" style={{ marginLeft: '2px', marginBottom: '10px' }}>Email:</label>
            <input
              type="email"
              name="email"
              className="form-control"
              placeholder="Registered email address"
              aria-label="Email Address"
              value={customerData.email}
              validate={[required]}
              required={true}
              pattern="[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,}$"
              title="Please enter your valid email address"
              disabled
            />
          </li>
          <li className="list-group-item" >
          <label htmlFor="name" style={{ marginLeft: '2px', marginBottom: '10px' }}>Name:</label>
            <input
              type="text"
              name=""
              className="form-control"
              placeholder="Name"
              value={customerData.name}
              onChange={(e) => setCustomerData(prevState => ({ ...prevState, name: e.target.value }))}
              required
            />
          </li>
          <li className="list-group-item" >
            <label htmlFor="mobile" style={{ marginLeft: '2px', marginBottom: '10px' }}>Mobile No.:</label>
            <input
              type="tel"
              className="form-control"
              placeholder="Mobile no. without country code"
              aria-label="Mobile no"
              value={customerData.phno}
              onChange={(e) => setCustomerData(prevState => ({ ...prevState, phno: e.target.value }))}
              pattern="^[0-9]{10}$"
              title="Please enter your valid mobile number"
              validate={[required, maxLengthMobileNo, minLengthMobileNo, digit]}
              required={true}
              max="9999999999"
              min="9999999999"
            />
          </li>


        </ul>
        <div className="card-body" style={{ marginTop: '12px' }}>
          <button
            type="submit"
            className="btn btn-primary  d-flex"
            disabled={submitting}
            style={{ background: "black", borderColor: "black" }}
          >
            Save
          </button>
        </div>
      </div>
    </form>
  );
};
export default compose(
  reduxForm({
    form: "profile",
  })
)(ProfileForm);
